INSERT INTO `AYUDAXINDICADOR` VALUES (1,1,0,0.0000000,0.0000000,'Indicar al dueño de la propiedad que debe instalar un sistema de tratamiento de aguas negras.\nEn caso de que el dueño no responda en un periodo de tres meses, trasladar el caso al Ministerio de Salud y Municipalidad.'),(1,1,1,1.0000000,1.0000000,'Mantener un plan de vigilancia para identificar la descarga de residuales en los caños o canales de conducción de agua lluvia ni ríos o quebradas.'),(2,1,0,0.0000000,0.0000000,'Mantener vigilancia permanente de las aguas grises, para el control de descarga de aguas grises en los caños de recolección y transporte de aguas lluvias. '),(2,1,1,1.0000000,1.0000000,'Elaborar e implementar un programa de educación ambiental con el fin de sensibilizar a la comunidad en el tema del uso racional del agua, de forma tal que se reduzca la producción de aguas grises (ducha, lavamanos, lavado de ropa y platos, limpieza de la vivienda, etc).  \nEn el lavado de utensilios de cocina se debe evitar la descarga de alimentos por el fregadero y así controlar la presencia de roedores y olores. \nEn coordinación la Municipalidad se deben iniciar acciones para la construcción de un alcantarillado sanitario con planta de tratamiento de aguas residuales domésticas.  \nEn zonas rurales incentivar el uso de tratamientos individuales de aguas grises, como por ejemplo biojardineras.'),(3,1,0,0.0000000,0.0000000,'Realizar las gestiones ante la Municipalidad respectiva para la construcción de un sistema de alcantarillado pluvial, separándolo del sistema de alcantarillado sanitario, de forma que su funcionamiento sea independiente.  '),(3,1,1,1.0000000,1.0000000,'Vigilar junto con la Municipalidad, la operación y mantenimiento los sistemas de recolección y descarga de las aguas pluviales .'),(4,1,0,0.0000000,0.0000000,' Iniciar acciones en coordinación con la Municipalidad respectiva, para implementar un sistema de alcantarilllado sanitario con planta de tratamiento de aguas residuales'),(4,1,1,1.0000000,1.0000000,' Vigilar junto con el responsable directo de la operación y mantenimiento de la planta de tratamiento de aguas residuales, que la misma, tenga un adecuado funcionamiento de acuerdo con la normativa nacional.'),(5,1,0,0.0000000,75.0000000,'Si el porcentaje de liquidez es menor al 75 %:\n1)	se debe realizar una revisión de tarifas del sistema de acueducto, para aumentar la liquidez de su ASADA, solictar asesoria al AyA.\n2)	Buscar alianza con otras ASADAs cercanas, para relizar actividades en conjunto que disminuyan gastos. Por ejemplo compartir la Secretaria, Fontanero, compras de materiales e insumos. _x000D_\n3)	Realizar gestiones para accesar recursos no reembolsables de cooperación internacional y nacional. Recomendaciones para la condición.\n4)	Buscar asesorías contables y administrativas para mejorar la liquidez de su ASADA.\n5)	Continuar vigilante de sus sistema administrativo y contable, para que se mantenga su liquidez igual al 100%, mostrando una sostenibilidad para el funcionamiento de su acueducto.'),(6,2,0,0.0000000,90.0000000,' Si tiene menos del 90% en recolección de residuos sólidos no valorizables, enviar recordatorio a la  Municipalidad de su Cantón de acuerdo a la ley GIR con copia al Ministerio de Salud. Con el objetivo de alcanzar el 100 % de cobertura buscar alianzas para fortalecer la educación ambiental.                                                      '),(7,2,0,0.0000000,0.0000000,'Iniciar gestiones con la Municipalidad, para que se implemente la recolección de residuos sólidos valorizables en su comunidad.\n Mantener campañas de educación ambiental a su comunidad en el tema de la gestión integral de residuos sólidos valorizables.'),(7,2,1,1.0000000,1.0000000,'Mantener una comunicación eficaz con la Municpalidad respectiva de forma tal, que el sistema de recolección de residuos sólidos valorizables se mantenga.  '),(8,2,0,0.8000000,6.0000000,'Si el indice de residuos sólidos per capita es superior al 0,8 Kg-persona-dia se debe solicitar a la Municipalidad que identifique el ingreso de materiales provenientes de empresas, comercios, agroindustria e instituciones que están mezclandose con los RS Municipales ordinarios. \nTambién que se implemente planes de educación ambiental para  aumentar la recuperación de materiales valorizables que están mezclándose con los residuos sólidos.  \nLa ASADA en coordinanción con la Municipalidad, podría apoyar en campañas de educación ambiental en su comunidad.'),(9,2,0,0.0000000,100.0000000,'Si la inversión anual en Gestión Integral de Residuos Sólidos (GIRS) por persona por año en el cantón es inferior a 100 US $  con el objetivo de evitar contaminación del suelo es necesario que la Municipalidad aumente los montos, por lo cual se recomienda a la ASADA enviar a la municipalidad una nota solicitándole revise los montos asignados en la Gestión Integral de los Residuos. '),(10,2,0,0.0000000,3.0000000,'Si la inversión en la limpieza de vias y áreas comunes por persona en cada cantón annual es inferior a  3 US$ con el objetivo de evitar la degradación de vias y zonas comunes necesario que la Municipalidad aumente los montos, por lo cual se recomienda enviarle una nota solicitándole revise los montos asignados en GIR'),(11,3,0,0.0000000,0.0000000,'Las o la captación del agua de la ASADA no está en zona protegida por el Estado, por lo que es importante que se proteja de forma que se pueda conservar el agua para las futuras generaciones. (reforestación, compra de terrero etc) '),(11,3,1,1.0000000,1.0000000,'La ASADA debe vigilar el mantenimiento rutinario  de la captación por parte Estado. '),(12,3,0,0.0000000,0.0000000,'Es muy importante que se las zonas de protección de las fuentes de agua esté legalmente demarcadas para evitar daños a las mismas'),(12,3,1,1.0000000,1.0000000,'Vigilar que la demarcación de la zona protegida de las fuentes de agua se les dé mantenimiento rutinario .'),(13,3,0,0.0000000,0.0000000,'Vigilar que la demarcación de la zona protegida de las fuentes de agua se les dé mantenimiento rutinario .'),(13,3,1,1.0000000,1.0000000,'Dar seguimiento al estudio del balance hidrico. \nCapacitar a la comunidad en el un uso sostenible del agua. \nCoordinar con ONGs, Ministerio de Educación Pública, Universidades y empresa privada para capacitar los grupos meta.'),(14,3,0,250.0000000,999.9999999,'Realizar campañas de educación ambiental dirigidas a la comunidad con el objetivo de reducir del consumo de agua por persona. \nEn agroindustrias o pequeñas industrias con procesos industriales húmedos, aplicar metodologías de producción más limpia.\nContar con un registro mensual promedio para garantizar el consumo sostenible del agua.'),(15,3,0,0.0000000,0.0000000,'Debe elaborar un plan de atención integral de riesgos, puede solicitar asesoría a AyA, Universidades públicas , ONGs.\nEjecutar el plan de atención de riesgo y darle seguimiento.\nSocializar el plan en sus redes sociales y en la comunidad.'),(15,3,1,1.0000000,1.0000000,'Actualizar el Plan de atención integral de riesgos al menos cada dos años'),(16,3,0,0.0000000,0.0000000,' Se debe elaborar un programa para la adaptación al cambio climático, puede solicitar asesoría a AyA, Universidades públicas, ONGs'),(16,3,1,1.0000000,1.0000000,'Actualizar el programas para adaptación al cambio climático cada año.'),(17,3,0,0.0000000,0.0000000,'Implementar la cultura de realizar aforos en las fuentes del acueducto con una frecuencia mensual.\nCotejar los registros de agua consumida por los usuarios contra los registros de los aforos realizados en las fuentes, establecer las posibles pérdidas. '),(17,3,1,1.0000000,1.0000000,'Los datos de los aforos de las fuentes se deben utilizar la contruccíón indicadores o controles de eficiencia, balances hídricos y realizar acciones para que población realice un uos racional y eficiente del recurso hídrico.'),(18,4,0,0.0000000,0.0000000,'La ASADA según reglamentación del MINSALUD, debe realizar el plan operativo del acueducto, para lo cual debe hacer uso de la herremienta SERSA, la cual posee la metodologia para la evaluación de los riesgos de los componentes del acueducto. Reglamento 38924-S 2015. \nEn caso de no contar con personal capacitado para realizar el plan operativo del acueducto, solicitar asesoría al Ministerio de Salud Area Rectora Local'),(18,4,1,1.0000000,1.0000000,'Realizar la presentación del plan Operativo de su acueducto, según las fechas establecidas por el  Reglamento 38924-S 2015.'),(19,4,0,0.0000000,0.0000000,'Diseñar un plan para construir un sistema de desinfección con urgencia\nBuscar los fondos y capacitación para construir el sistema\nMantener y controlar el sistema de desinfección'),(19,4,1,1.0000000,1.0000000,'Vigilar la operación eficiente del sistema de desinfección.'),(20,4,0,0.0000000,0.0000000,'Si la calidad y cantidad del agua no son aceptables es necesario: Diseñar un plan para construir una planta potabilizadora , buscar los fondos y capacitación para construir el sistema, mantener y controlar la planta potabilizadora, buscar alianzas con AyA u otras ASADAs para administrar sistemas comunes.'),(20,4,1,1.0000000,1.0000000,'Vigilar la operación y mantenimiento de la Planta Potabilizadora'),(21,4,0,0.0000000,0.0000000,'Iniciar el proceso para obtener el sello de calidad sanitaria.'),(21,4,1,1.0000000,1.0000000,'Mantener las condiciones para continuar con el sello de calidad sanitaria.'),(22,5,0,0.0000000,10.0000000,'Morosidad entre  0% y 10%, la ASADA debe realizar acciones para  disminuir la morosidad de pago de los usuarios cada año, para alcanzar el nivel de cero morosidad. '),(22,5,1,11.0000000,100.0000000,'Morosidad mayor de 10%, en este caso la ASADA debe buscar asesoria con el AyA, con el fin de tener acciones para disminuir la morosidad de pago de los usuarios.'),(23,5,0,0.0000000,40.0000000,'Para un porcentaje de agua no contabilizada menor al 40%, la ASADA debe realizar revisión de los componentes del acueducto para establecer en cuales se presentan pérdidas de agua, con el fin de que se realicen mejoras para disminuir el porcentaje de agua no contabilizada.  '),(23,5,1,41.0000000,100.0000000,'Para un porcentaje de agua no contabilizada mayor al 40%, la ASADA se debe realizar del estudio del balance hidrico y localización de las perdidas mediante equipos especilaizados en componentes del acueducto en especial, en las redes de conducción y de distribucción.'),(24,6,0,0.0000000,100.0000000,'Según Mideplan si su índice está entre 100-72,5 su cantón se encuentra ubicado en el mayor desarrollo relativo. Si el valor esta entre 72,5-58 se encuentra en nivel medio. Para valores entre 57,9-43,9 se encuentra en nivel bajo. Valores inferiores a 43,8-0 estará ubicado en un nivel muy bajo. MIDEPLAN https://documentos.mideplan.go.cr/share/s/7gQJ5YXdSWKep9pZLfyzJA _x000D_'),(25,7,0,0.0000000,0.0000000,'La ASADA debe iniciar acciones para cumplir con los requisitos solicitados en el Programa Bandera Azul Ecológica.\nLa ASADA debe incentivar a la comunidad para que se inscriba y certifique en el Programa de Bandera Azul Ecológica.'),(25,7,1,1.0000000,1.0000000,'Velar por el mantenimiento de la bandera azul ecológica.'),(26,7,0,0.0000000,0.0000000,'Incorporar en el plan de trabajo acciones para desarrollar programas de educación ambiental comunal, coordinar estas acciones con la Municipalidad, ONGs, Universidades, Ministerio de Salud y Ministerio de Educación y MINAE. '),(26,7,1,1.0000000,1.0000000,'Continuar con los programas de educación ambiental.'),(27,8,1,1.0000000,1.0000000,'Coordinar con la Comisión Nacional de Emergencia para establecer planes de mitigación debido a los riesgos de inundación. Coordinar con la Municipalidad acciones conjuntas.\nMantener un fondo para reparaciones del acueducto por afectaciones de inudaciones. \nPlanificar el cambio de las infraestructuras hasta sitios con menos riesgo cuando sea posible. '),(28,8,1,1.0000000,1.0000000,'Coordinar con la Comisión Nacional de Emergencia para establecer planes de mitigación debido a los riesgos de deslizamiento. Coordinar con la Municipalidad acciones conjuntas. \nMantener un fondo para reparaciones del acueducto por afectaciones de deslizamiento.  \nPlanificar el cambio de las infraestructuras hasta sitios con menos riesgo cuando sea posible. '),(29,8,1,1.0000000,1.0000000,'Coordinar con la Comisión Nacional de Emergencia para establecer planes de mitigación debido a los riesgos volcánicos. Coordinar con la Municipalidad acciones conjuntas. \nMantener un fondo para reparaciones del acueducto por afectaciones volcánicas.  \nPlanificar el cambio de las infraestructuras hasta sitios con menos riesgo cuando sea posible. '),(30,8,1,1.0000000,1.0000000,'Coordinar con la Comisión Nacional de Emergencia para establecer planes de mitigación debido a los riesgos por zona sísmica. Coordinar con la Municipalidad acciones conjuntas. \nMantener un fondo para reparaciones del acueducto por afectaciones de sismo.  \nPlanificar el cambio de las infraestructuras hasta sitios con menos riesgo cuando sea posible. ');
/*!40000 ALTER TABLE `AYUDAXINDICADOR` ENABLE KEYS */;
UNLOCK TABLES;

